        <h2 v-if="this.stand.status === 'wait_attribution'" style="color: orange">{{$t('status.wait_attribution')}}</h2>
        <h2 v-if="this.stand.status === 'attributed'" style="color: green">{{$t('status.attributed')}}</h2>
        <h1 style="color: white">{{$t('attribute.location')}} {{$t('attribute.stand')}} {{this.emplacements.id_emplacement}}</h1>
        <h3 style="color: white">{{$t('attribute.from')}} {{this.emplacements.datedebut}} {{$t('attribute.to')}} {{this.emplacements.datefin}}</h3>

        <v-btn v-if="this.emplacements.cancel" outlined disabled dark small @click="cancel">{{ $t('button.cancelSignupInProgress') }}</v-btn>
        <v-btn v-else color="red" dark @click="cancel">{{ $t('button.cancelSignup') }}</v-btn>
        <v-btn class="ma-2" @click="goTo('/prestataire/stands')">{{ $t('button.back') }}</v-btn>
